header {

  .header__banner__desk {
    position: relative;
    width: 100%;
    height: 747px;


    &::after {
      content: '';
      display: block;
      position: absolute;
      top: 0;
      left: 0;
      right: 0;
      bottom: 0;
      background: #252B49;
      opacity: .8;
      width: 99.5%;
    }
  }

  .header__up {
    height: 100px;
    width: 100%;
    position: absolute;
    display: flex;
    color: $color_text;
    justify-content: space-around;
    z-index: 15;
    top: 0;
    margin: 0 auto;
    align-items: center;

    #banner {
      margin-left: 50px;
    }

    .burger {
      display: none;
    }


    nav button {
      text-decoration: none;
      font-weight: 700;
      font-size: 13px;
      color: $color_text;
      width: 134px;
      height: 100px;
      background-color: transparent;
      border: none;
      @include text_raleway_uppercase;

      &:hover {
        border-bottom: 3px solid #BABBC5;
      }

      &:active {
        color: #E71414;
        border-bottom: 3px solid #E71414;
      }
    }

    .separator--light {
      border: .5px solid #BABBC5;
      width: 1260px;
      position: absolute;
      top: 100px;
    }

  }

  .header__text {
    display: flex;
    justify-content: center;

    & br {
      display: none;
    }

    & h1 {
      position: absolute;
